import React, {useEffect, useState} from "react";


const Post = ()=>{

    const [feed, setfeed] = useState([]);
    
    const getPosts =  ()=>{
         fetch('http://localhost:4000/feed', {
          method: "GET",
          credentials: "include"
        }).then(response=>{
               response.json().then(feed=>{
                setfeed(feed)
               })
        })
      }
    
  useEffect(()=>{getPosts()});
   
    return(
        <>
       </>
    )
}

export default Post;
